import { HttpClient, HttpHeaders } from '@angular/common/http';
import { Component, OnInit } from '@angular/core';
import { environment } from 'src/environments/environment';

@Component({
  selector: 'app-take-help',
  templateUrl: './take-help.component.html',
  styleUrls: ['./take-help.component.css']
})


export class TakeHelpComponent implements OnInit{
  transactions: any[]=[];
  selectedLevelData: number = 0;



  constructor(private http: HttpClient) {}

  ngOnInit(): void {
    this.fetchTransactions();
  }

  fetchTransactions(): void {
    const payerId = localStorage.getItem('_id');
    if (!payerId) {
      console.error('PayerId not found in localStorage');
      return;
    }

    const headers = new HttpHeaders({
      'Authorization': `Bearer ${localStorage.getItem('token')}`
    });


    this.http.get<any[]>(`${environment.apiUrl}/payments/getMatrixSummary/${payerId}`, { headers })
      .subscribe(
        response => {
          this.transactions = response;
          console.log(response);
        },
        error => {
          console.error('Error fetching transactions:', error);
        }
      );
  }

  selectLevel(level: any): void {
    this.selectedLevelData = level;
  }
}
